fields.description:
As a Content Editor I would like to leverage the versioning feature offered by Kontent so I can create a new version of an already published Playbook to make updates while ensuring the previous Published version remains accessible to end users until I publish the new version.

Currently versioning causes issues to our Playbook Worker because the ids are the same and any playbook marked published blocks updates. We will switch to using composite ids, that is appending the -draft or -published suffix to each id. 

* {{123456-123456-draft}}
* {{123456-123456-published}}

